import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)
const state = {}
const mutations = {}
const actions = {}
const getters = {}
const modules = {}

export default new Vuex.Store({
    state,
    mutations,
    actions,
    getters,
    modules
})
